import './App.css';
import Header from './Header/Header';

import ContentsList from './Contents/ContentsList/ContentsList';

const LeftBar = () => {
  console.log("LeftBar-Part");

  return <div className="LeftBar">LeftBar</div>;
};

const RightBar = () => {
  console.log("RightBar-Part");

  return <div className="RightBar">RightBar</div>;
};

//const Footer = () => {
//  console.log("Footer");
//  return <footer>Copyright @ 2021 test</footer>;
