export default function App() {
  return (
    <div className="App">
      {/*App*/}
      <main>
        {/*main*/}
        <div className="Header">
          <Header />
        </div>
        <div className="Contents">
          {/*Contents*/}
          <LeftBar />
          <ContentsList />
          <RightBar />
        </div>
        {/*<div className="Footer">
          <Footer />
        </div>*/}
      </main>
    </div>
  );
}
